import React from 'react'

const FieldComponent = ({ field, onDelete }) => {
  return (
      <div className="field-component shadow-md rounded-lg p-4 mb-4">
        <div className="flex justify-between items-start">
          <div>
            <p className="mb-2">
              <strong className="text-indigo-600">Question:</strong> {field.question}
            </p>
            {field.type !== 'text' && (
              <p className="mb-2">
                <strong className="text-indigo-600">Options:</strong> {field.options.join(', ')}
              </p>
            )}
            <p className="mb-2">
              <strong className="text-indigo-600">Applicable To:</strong> {field.applicableTo}
            </p>
          </div>
          <button
            onClick={() => onDelete(field.id)}
            className="bg-red-500 text-white rounded-md px-3 py-1 hover:bg-red-600"
          >
            Delete Field
          </button>
        </div>
      </div>


  )
}

export default FieldComponent
